# Install cloudofficeprint using  pip install cloudofficeprint
import cloudofficeprint as cop  # Import the cloudofficeprint libary.
# Main object that holds the data
collection = cop.elements.ElementCollection()
# Create the title element and add it to the element collection
title = cop.elements.Property(
    name="title",
    value="Hello World!"
)
collection.add(title)

# Create the text element and add it to the element collection
text = cop.elements.Property(
    name="text",
    value="This is an example created with the Cloud Office Print Python SDK"
)
collection.add(text)

# configure server
# For running on localhost you do not need api_key else replace below "YOUR_API_KEY" with your api key.
server = cop.config.Server(
    "http://localhost:8010/",
    cop.config.ServerConfig(api_key="YOUR_API_KEY")
)

# Creating a array that holds all the type of template loading.
templates = {}

# /-----------FROM URL------------------#
UrlTemplate = cop.Resource.from_url(
    'https://docs.google.com/document/d/1CCBbvNjI2FwIHXJoG2F3HsY7ncskeUhKj0LkqAVZtHA/edit?usp=sharing', 'docx')

templates['url_template'] = UrlTemplate


# -----------FROM LOCAL FILE-----------#
LocalFile = cop.Resource.from_local_file('./data/template.docx')
templates['local_file'] = LocalFile


#-----------BASE64---------------#
Base64 = cop.Resource.from_base64("", 'docx')
templates['base64'] = Base64


#----------Buffer-------------#
# BufferTemplate = cop.Resource.from_raw(open('./data/template.docx','rb'),'docx')
# templates['buffer_template'] = BufferTemplate
# print(BufferTemplate)

#----------Server_Path---------#
# File should be available at the apexofficeprint server.
serverPathTemplate = cop.Resource.from_server_path(
    "./testFolder/template.docx")
templates['serverPathTemplate'] = serverPathTemplate

# ---------------htmlTemplate--------#
htmlTemplate = cop.Resource.from_html("""
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Template</title>
</head>
<body>
    <img src="data:image/png;base64,">
    <p>
        {title}
    </p>
    <p>
        {text}
    </p>
</body>
</html>
""")
# templates['htmlTemplate'] = htmlTemplate
for i in templates:
    # Create print job
    # PrintJob combines template, data, server and an optional output configuration
    template_type = templates[i].template_dict.get('template_type')
    printjob = cop.PrintJob(
        data=collection,
        server=server,
        template=templates[i],
    )
    # Execute print job and save response to file
    response = printjob.execute()
    response.to_file(".\\output\\output_"+i+template_type)
